import './App.css';

import MainPage from "./mainpage/MainPage";

import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import HomeContent from "./pages/src/home";


function App() {
  return (
    <div>
        <Router>
            <Switch>
                <Route path="/">
                    <HomeContent/>
                </Route>
            </Switch>
        </Router>
    </div>
  );
}


export default App;
